import React, { useState } from 'react';
import {
  Box,
  Paper,
  Typography,
  TextField,
  Button,
  Alert,
  CircularProgress,
  InputAdornment,
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import XIcon from '../Icons/XIcon';

const AccountTracker = () => {
  const [username, setUsername] = useState('');
  const [trackingResult, setTrackingResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const startTracking = async () => {
    try {
      setLoading(true);
      const response = await fetch('/api/twitter/track', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username: username.replace('@', '') }),
      });

      const data = await response.json();
      if (!data.success) {
        throw new Error(data.error || 'Failed to track account');
      }

      setTrackingResult(data.data);
      setUsername('');
    } catch (error) {
      console.error('Error:', error);
      setTrackingResult({ 
        error: error.message.includes('rate limit') 
          ? 'Twitter API rate limit reached. Please try again in a few minutes.'
          : error.message 
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Paper 
      sx={{ 
        p: 2,
        borderRadius: 2, 
        bgcolor: 'background.paper',
        minHeight: '80px',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      }}
    >
      <Box sx={{ width: '100%', maxWidth: 500, textAlign: 'center' }}>
        <Typography variant="subtitle1" gutterBottom sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          gap: 1,
          mb: 1,
          justifyContent: 'center'
        }}>
          <XIcon color="primary" fontSize="small" />
          Track New Account
        </Typography>

        <Box sx={{ display: 'flex', gap: 1, alignItems: 'center' }}>
          <TextField
            size="small"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="Enter username to track"
            variant="outlined"
            sx={{ 
              flex: 1,
              '& .MuiOutlinedInput-root': {
                bgcolor: 'background.paper',
              }
            }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <Typography color="text.secondary">@</Typography>
                </InputAdornment>
              ),
            }}
          />
          {!username && (
            <Typography 
              variant="body2" 
              color="text.secondary" 
              sx={{ 
                mt: 1,
                textAlign: 'center',
                fontStyle: 'italic'
              }}
            >
              Enter an X username to start tracking their posts
            </Typography>
          )}
          <Button
            variant="contained"
            size="medium"
            onClick={startTracking}
            disabled={loading || !username}
            startIcon={<AddIcon sx={{ color: '#E8E8E8' }} />}
            sx={{
              background: 'linear-gradient(45deg, #000000 30%, #2C2C2C 90%)',
              boxShadow: '0 3px 8px 2px rgba(0, 0, 0, 0.3)',
              color: '#E8E8E8',
              minWidth: '120px',
              height: '40px',
              borderRadius: '8px',
              textTransform: 'none',
              fontWeight: 600,
              letterSpacing: '0.5px',
              border: '1px solid rgba(255, 255, 255, 0.1)',
              backdropFilter: 'blur(4px)',
              '&:hover': {
                background: 'linear-gradient(45deg, #1A1A1A 30%, #383838 90%)',
                boxShadow: '0 4px 10px 3px rgba(0, 0, 0, 0.4)',
                borderColor: 'rgba(255, 255, 255, 0.2)',
              },
              '& .MuiButton-startIcon': {
                marginRight: 1,
              },
              '& .MuiSvgIcon-root': {
                fontSize: '1.2rem',
              },
              '& .MuiButton-label': {
                background: 'linear-gradient(to right, #E8E8E8, #FFFFFF)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
              }
            }}
          >
            {loading ? 'Adding...' : 'Add Account'}
          </Button>
        </Box>
      </Box>

      {trackingResult && (
        <Box sx={{ mt: 2, width: '100%', maxWidth: 500 }}>
          {trackingResult.error ? (
            <Alert severity="error" sx={{ mb: 1 }}>
              {trackingResult.error}
            </Alert>
          ) : (
            <Alert severity="success" sx={{ mb: 1 }}>
              Now tracking: @{trackingResult.user?.username}
            </Alert>
          )}
        </Box>
      )}
    </Paper>
  );
};

export default AccountTracker;
